package imageslicer_test

import (
	"encoding/base64"
	"github.com/goferHiro/imageslicer"
	"image/jpeg"
	"strings"
	"testing"
)

func TestSlice(t *testing.T) {

	base64Image := ""

	//base64Image = strings.TrimSuffix(base64Image[5:], ";base64")

	reader := base64.NewDecoder(base64.StdEncoding, strings.NewReader(base64Image))

	img, err := jpeg.Decode(reader)

	if err != nil {
		t.Fatalf("%s unable to decode the img", t.Name())
	}

	grids := [][2]uint{
		{1, 1},
		{1, 2},
		{1, 10},
		{2, 0},
		{2, 1},
		{3, 1},
		{3, 2},
		{3, 3},
		{3, 6},
		{5, 6},
		{7, 20},
		{10, 10},
		{10, 20},
	}

	for _, grid := range grids {
		tiles := imageslicer.Slice(img, grid)

		expectedNoOfTiles := grid[0] * grid[1]

		if len(tiles) != int(expectedNoOfTiles) {
			t.Errorf("expected %d != %d", expectedNoOfTiles, len(tiles))
		} else {
			t.Logf("%v split passed", grid)
		}

		joinedImg, err := imageslicer.Join(tiles, grid)
		if err != nil {
			t.Errorf("joining failed due to %s", err)
		}

		t.Logf("joinedImg %v %v", joinedImg.Bounds(), img.Bounds())
	}

}
